import React from 'react';
import './custom-button.styles.scss';

const CustomButton = ({children,isCheckIn, ...props}) => {
    return (
        <div>
            <button className={`${isCheckIn ? 'check-in' : isCheckOut ? 'checkout' : '' }  custom-button`}>
                {children}
            </button>
        </div>
    )
}

export default CustomButton
